#
# Structure for table "jj_msck"
#

CREATE TABLE `jj_msck` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(11) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `qk` varchar(255) DEFAULT NULL COMMENT '情况',
  `ljsy` varchar(255) DEFAULT NULL COMMENT '累计收益',
  `desc` varchar(255) DEFAULT NULL,
  `chysy` varchar(255) DEFAULT NULL COMMENT '持有收益',
  `mbm` varchar(255) DEFAULT NULL COMMENT '买不买',
  `show` int(11) NOT NULL DEFAULT '0',
  `who` varchar(255) DEFAULT NULL,
  `mb` varchar(255) DEFAULT NULL COMMENT '目标',
  `money` varchar(255) DEFAULT NULL COMMENT '现在是多少',
  `today` varchar(255) NOT NULL DEFAULT '' COMMENT '今天买卖多少',
  `dq` varchar(255) DEFAULT NULL COMMENT '定期',
  `class` int(11) NOT NULL DEFAULT '0' COMMENT '分类',
  `time` char(10) NOT NULL DEFAULT '2017-10-19',
  `changduan` varchar(255) NOT NULL COMMENT '长期持有:短期持有',
  `gl` varchar(255) DEFAULT NULL COMMENT '概率',
  `bfb` varchar(255) DEFAULT NULL COMMENT '涨的多少，和跌的多少',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `code` (`code`,`time`)
) ENGINE=MyISAM AUTO_INCREMENT=3135 DEFAULT CHARSET=utf8 COMMENT='买时参考';

