#
# Structure for table "jj_transaction"
#

CREATE TABLE `jj_transaction` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0',
  `code` char(6) NOT NULL DEFAULT '',
  `money` decimal(10,2) NOT NULL DEFAULT '0.00',
  `fen` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '份',
  `type` tinyint(3) NOT NULL DEFAULT '0' COMMENT '1为买入，-1为卖出',
  `time` char(19) NOT NULL DEFAULT '',
  `guess` varchar(255) NOT NULL DEFAULT '' COMMENT '猜测备注',
  `is_use` tinyint(3) NOT NULL DEFAULT '0' COMMENT '1已经完全卖出，2部分卖出，0没有卖出，1卖出已经减过，0卖出没有减过过',
  `fen2` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '卖出份额',
  PRIMARY KEY (`Id`)
) ENGINE=MyISAM AUTO_INCREMENT=3499 DEFAULT CHARSET=utf8;

