#
# Structure for table "jj_user_code"
#

CREATE TABLE `jj_user_code` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) unsigned NOT NULL DEFAULT '0',
  `code` char(6) NOT NULL DEFAULT '',
  `selected` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否持有',
  `attention` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '关注程度',
  `begin_time` char(11) DEFAULT '' COMMENT '计划周期',
  `end_time` char(11) DEFAULT '' COMMENT '计划周期',
  `rzzl` decimal(10,2) DEFAULT NULL COMMENT '计划收益',
  PRIMARY KEY (`Id`),
  UNIQUE KEY `ucode` (`user_id`,`code`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

